threads_resolved\";i:85;s:15:\"active_installs\";i:3000000;s:17:\"short_description\";s:173:\"L\'éditeur frontend par glissé / déposé le plus avancé. Créez des sites parfait au pixel prêt en un temps record. Tous les thèmes, toutes les pages, tous les designs.\";s:13:\"download_link\";s:58:\"https://downloads.wordpress.org/plugin/elementor.2.8.1.zip\";s:11:\"screenshots\";a:7:{i:1;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-1.gif?rev=1608747\";s:7:\"caption\";s:149:\"<strong>Glisser & déposer</strong> Notre glisser & déposer instantané vous permet de placer facilement chaque élément n\'importe où sur la page.\";}i:2;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-2.gif?rev=1608747\";s:7:\"caption\";s:137:\"<strong>Visual Resize Control.</strong> Customize the various elements of the page. Resizing images, changing column sizes and much more.\";}i:3;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-3.gif?rev=1494133\";s:7:\"caption\";s:182:\"<strong> Réellement modifier en direct. </strong> Les modifications apportées à la page sont affichées en temps réel. Pas besoin de cliquer sur mettre à jour ou prévisualiser.\";}i:4;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-4.gif?rev=1608747\";s:7:\"caption\";s:208:\"<strong>Bibliothèque de modèles.</strong> Enregistrez vos pages ou sections comme modèles, ainsi vous pouvez facilement les utiliser à nouveau, ou en choisir un parmi nos plus beaux modèles pré-conçus.\";}i:5;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-5.gif?rev=1608747\";s:7:\"caption\";s:165:\"<strong>Conception responsive.</strong> Créez des réglages personnalisés pour les ordinateurs de bureau, les tablettes & mobiles en permutant entre les appareils.\";}i:6;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-6.gif?rev=1608748\";s:7:\"caption\";s:147:\"<strong>Revision History.</strong> Switch between earlier versions of your page design, so your design process is backed up, every step of the way.\";}i:7;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-7.gif?rev=1608748\";s:7:\"caption\";s:159:\"<strong>Shape Divider.</strong> Choose from a wide array of shape dividers and separate your sections in endless ways, that until now were simply not possible.\";}}s:8:\"versions\";a:281:{s:5:\"0.1.0\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.0.zip\";s:5:\"0.1.1\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.1.zip\";s:5:\"0.1.2\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.2.zip\";s:5:\"0.1.3\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.3.zip\";s:5:\"0.1.4\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.4.zip\";s:5:\"0.1.5\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.5.zip\";s:5:\"0.1.6\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.6.zip\";s:5:\"0.1.7\";s:58:\"https://downloads.wordpress.org/plugin/elementor.0.1.7.zip\";s:6:\"0.10.0\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.0.zip\";s:6:\"0.10.1\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.1.zip\";s:6:\"0.10.2\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.2.zip\";s:6:\"0.10.3\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.3.zip\";s:6:\"0.10.4\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.4.zip\";s:6:\"0.10.5\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.5.zip\";s:6:\"0.10.6\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.6.zip\";s:6:\"0.10.7\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.10.7.zip\";s:6:\"0.11.0\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.11.0.zip\";s:6:\"0.11.1\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.11.1.zip\";s:6:\"0.11.2\";s:59:\"https://downloads.wordpress.org/plugin/elementor.0.11.2.zip\";s:5:\"0.2.0\";s:58:\"https://downloads.word