INSERT INTO `wp_posts` VALUES (1,1,'2019-12-16 08:40:54','2019-12-16 07:40:54','<!-- wp:paragraph -->\n<p>Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis commencez à écrire !</p>\n<!-- /wp:paragraph -->','Bonjour tout le monde !','','trash','open','open','','bonjour-tout-le-monde__trashed','','','2019-12-16 08:42:55','2019-12-16 07:42:55','',0,'http://192.168.33.60/projet3/wordpress/?p=1',0,'post','',1),(2,1,'2019-12-16 08:40:54','2019-12-16 07:40:54','<!-- wp:paragraph -->\n<p>Ceci est une page dédiée à la vente de téléviseurs haut de gamme. Vous trouverez de nombreuses marques mais seule 2 seront mise en avant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"overlayColor\":\"very-dark-gray\"} -->\n<div class=\"wp-block-cover has-very-dark-gray-background-color has-background-dim\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Rédigez le titre…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">La Télé qui nous regarde !</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:heading -->\n<h2>Qu\'est-ce que le Lorem Ipsum?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le <strong>Lorem Ipsum</strong> est simplement du faux texte employé dans la composition et la mise en page avant impression. Le Lorem Ipsum est le faux texte standard de l\'imprimerie depuis les années 1500, quand un imprimeur anonyme assembla ensemble des morceaux de texte pour réaliser un livre spécimen de polices de texte. Il n\'a pas fait que survivre cinq siècles, mais s\'est aussi adapté à la bureautique informatique, sans que son contenu n\'en soit modifié. Il a été popularisé dans les années 1960 grâce à la vente de feuilles Letraset contenant des passages du Lorem Ipsum, et, plus récemment, par son inclusion dans des applications de mise en page de texte, comme Aldus PageMaker.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[45,46,47,48,49,51],\"columns\":2} -->\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/large02-1.jpg\" alt=\"\" data-id=\"45\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/large02-1/\" class=\"wp-image-45\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/lg-g-sync-oled-2.jpg\" alt=\"\" data-id=\"46\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/lg-g-sync-oled-2-2/\" class=\"wp-image-46\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/samsung-55q6fn-tv-qled-4k-uhd-55-138cm-hdr.jpg\" alt=\"\" data-id=\"47\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/samsung-55q6fn-tv-qled-4k-uhd-55-138cm-hdr/\" class=\"wp-image-47\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/ue55ru7305-1_product_medium.jpg\" alt=\"\" data-id=\"48\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/ue55ru7305-1_product_medium/\" class=\"wp-image-48\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/50PUS8804_12-IMS-fr_FR-1.jpg\" alt=\"\" data-id=\"49\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/50pus8804_12-ims-fr_fr-1/\" class=\"wp-image-49\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/91j1tEXpz9L._SX425_-1.jpg\" alt=\"\" data-id=\"51\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/91j1texpz9l-_sx425_-1/\" class=\"wp-image-51\"/><