monial-details\"><span class=\"uagb-tm__author-name\">John Doe </span><span class=\"uagb-tm__company\">Company1</span></div></div></div></div></div></div><div class=\"uagb-testimonial__wrap  uagb-tm__imgicon-style-circle uagb-tm__image-position-bottom uagb-tm__bg-type-undefined \"><div class=\"uagb-tm__content\"><div class=\"uagb-tm__overlay\"></div><div class=\"uagb-tm__text-wrap\"><div class=\"uagb-testinomial-text-wrap\"><div class=\"uagb-tm__desc\">I have been working with these guys since years now! With lots of hard work and timely communication they made sure they delivered the best to me. Highly recommended!</div></div><div class=\"uagb-tm__meta\"><div class=\"uagb-tm__meta-inner\"><div class=\"uagb-testimonial-details\"><span class=\"uagb-tm__author-name\">John Doe </span><span class=\"uagb-tm__company\">Company2</span></div></div></div></div></div></div><div class=\"uagb-testimonial__wrap  uagb-tm__imgicon-style-circle uagb-tm__image-position-bottom uagb-tm__bg-type-undefined \"><div class=\"uagb-tm__content\"><div class=\"uagb-tm__overlay\"></div><div class=\"uagb-tm__text-wrap\"><div class=\"uagb-testinomial-text-wrap\"><div class=\"uagb-tm__desc\">I have been working with these guys since years now! With lots of hard work and timely communication they made sure they delivered the best to me. Highly recommended!</div></div><div class=\"uagb-tm__meta\"><div class=\"uagb-tm__meta-inner\"><div class=\"uagb-testimonial-details\"><span class=\"uagb-tm__author-name\">John Doe </span><span class=\"uagb-tm__company\">Company3</span></div></div></div></div></div></div></div></div>\n<!-- /wp:uagb/testimonial -->','Accueil','','publish','closed','open','','page-d-exemple','','','2019-12-16 09:53:22','2019-12-16 08:53:22','',0,'http://192.168.33.60/projet3/wordpress/?page_id=2',1,'page','',0),(3,1,'2019-12-16 08:40:54','2019-12-16 07:40:54','<!-- wp:heading --><h2>Qui sommes-nous ?</h2><!-- /wp:heading --><!-- wp:paragraph --><p>L’adresse de notre site Web est : http://192.168.33.60/projet3/wordpress.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Utilisation des données personnelles collectées</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Commentaires</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Quand vous laissez un commentaire sur notre site web, les données inscrites dans le formulaire de commentaire, mais aussi votre adresse IP et l’agent utilisateur de votre navigateur sont collectés pour nous aider à la détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Une chaîne anonymisée créée à partir de votre adresse de messagerie (également appelée hash) peut être envoyée au service Gravatar pour vérifier si vous utilisez ce dernier. Les clauses de confidentialité du service Gravatar sont disponibles ici : https://automattic.com/privacy/. Après validation de votre commentaire, votre photo de profil sera visible publiquement à coté de votre commentaire.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Médias</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous êtes un utilisateur ou une utilisatrice enregistré·e et que vous téléversez des images sur le site web, nous vous conseillons d’éviter de téléverser des images contenant des données EXIF de coordonnées GPS. Les visiteurs de votre site web peuvent télécharger et extraire des données de localisation depuis ces images.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulaires de contact</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous déposez un commentaire sur notre site, il vous sera proposé d’enregistrer votre nom, adresse de messagerie et site web dans des cookies. C’est uniquement pour votre confort afin de ne pas avoir à saisir ces informations si vous déposez un autre commentaire plus tard. Ces cookies expirent au bout d’un an.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si vous vous rendez sur la page de connexion, un cookie temporaire sera créé afin de déterminer si votre navigateur accepte les cookies. Il ne contient pas de données personnelles et sera supprimé automatiquement à la fermeture de votre navigateur.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos préférences d’écran. La durée de vie d’un cookie de connexion est de deux jours, celle d’un cookie d’option d’écran est d’un an. Si vous cochez « Se souvenir de moi », votre cookie de connexion sera conservé pendant deux semaines. Si vous vous déconnectez de votre compte, le cookie de connexion sera effacé.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>En modifiant ou en publiant une publication, un cookie supplémentaire sera enregistré dans votre navigateur. Ce cookie ne comprend aucune donnée personnelle. Il indique simplement l’ID de la publication que vous venez de modifier. Il expire au bout d’un jour.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenu embarqué depuis d’autres sites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Les articles de ce site peuvent inclure des contenus intégrés (par exemple des vidéos, images, articles…). Le contenu intégré depuis d’autres sites se comporte de la même manière que si le visiteur se rendait sur cet autre site.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Ces sites web pourraient collecter des données sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqués si vous disposez d’un compte connecté sur leur site web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Statistiques et mesures d’audience</h3><!-- /wp:heading --><!-- wp:heading --><h2>Utilisation et transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:heading --><h2>Durées de stockage de vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous laissez un commentaire, le commentaire et ses métadonnées sont conservés indéfiniment. Cela permet de reconnaître et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modération.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Pour les utilisateurs et utilisatrices qui s’enregistrent sur notre site (si cela est possible), nous stockons également les données personnelles indiquées dans leur profil. Tous les utilisateurs et utilisatrices peuvent voir, modifier ou supprimer leurs informations personnelles à tout moment (à l’exception de leur nom d’utilisateur·ice). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Les droits que vous avez sur vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous avez un compte ou si vous avez laissé des commentaires sur le site, vous pouvez demander à recevoir un fichier contenant toutes les données personnelles que nous possédons à votre sujet, incluant celles que vous nous avez fournies. Vous pouvez également demander la suppression des données personnelles vous concernant. Cela ne prend pas en compte les données stockées à des fins administratives, légales ou pour des raisons de sécurité.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Les commentaires des visiteurs peuvent être vérifiés à l’aide d’un service automatisé de détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informations de contact</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informations supplémentaires</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comment nous protégeons vos données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Procédures mises en œuvre en cas de fuite de données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Les services tiers qui nous transmettent des données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Opérations de marketing automatisé et/ou de profilage réalisées à l’aide des données personnelles</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Affichage des informations liées aux secteurs soumis à des régulations spécifiques</h3><!-- /wp:heading -->','Politique de confidentialité','','draft','closed','open','','politique-de-confidentialite','','','2019-12-16 08:40:54','2019-12-16 07:40:54','',0,'http://192.168.33.60/projet3/wordpress/?page_id=3',0,'page','',0),(4,1,'2019-12-16 08:41:07','0000-00-00 00:00:00','','Brouillon auto','','auto-draft','open','open','','','','','2019-12-16 08:41:07','0000-00-00 00:00:00','',0,'http://192.168.33.60/projet3/wordpress/?p=4',0,'post','',0),(5,1,'2019-12-16 08:42:55','2019-12-16 07:42:55','<!-- wp:paragraph -->\n<p>Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis commencez à écrire !</p>\n<!-- /wp:paragraph -->','Bonjour tout le monde !','','inherit','closed','closed','','1-revision-v1','','','2019-12-16 08:42:55','2019-12-16 07:42:55','',1,'http://192.168.33.60/projet3/wordpress/index.php/2019/12/16/1-revision-v1/',0,'revision','',0),(6,1,'2019-12-16 08:42:59','0000-00-00 00:00:00','','Brouillon auto','','auto-draft','open','open','','','','','2019-12-16 08:42:59','0000-00-00 00:00:00','',0,'http://192.168.33.60/projet3/wordpress/?p=6',0,'post','',0),(7,1,'2019-12-16 08:45:24','2019-12-16 07:45:24','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2019-12-16 08:45:24','2019-12-16 07:45:24','',0,'http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/woocommerce-placeholder.png',0,'attachment','image/png',0),(8,1,'2019-12-16 08:45:56','2019-12-16 07:45:56','','Boutique','','publish','closed','closed','','boutique','','','2019-12-16 08:45:56','2019-12-16 07:45:56','',0,'http://192.168.33.60/projet3/wordpress/index.php/boutique/',0,'page','