 nombreuses marques mais seule 2 seront mise en avant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"overlayColor\":\"very-dark-gray\"} -->\n<div class=\"wp-block-cover has-very-dark-gray-background-color has-background-dim\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Rédigez le titre…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">La Télé qui nous regarde !</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:heading -->\n<h2>Qu\'est-ce que le Lorem Ipsum?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le <strong>Lorem Ipsum</strong> est simplement du faux texte employé dans la composition et la mise en page avant impression. Le Lorem Ipsum est le faux texte standard de l\'imprimerie depuis les années 1500, quand un imprimeur anonyme assembla ensemble des morceaux de texte pour réaliser un livre spécimen de polices de texte. Il n\'a pas fait que survivre cinq siècles, mais s\'est aussi adapté à la bureautique informatique, sans que son contenu n\'en soit modifié. Il a été popularisé dans les années 1960 grâce à la vente de feuilles Letraset contenant des passages du Lorem Ipsum, et, plus récemment, par son inclusion dans des applications de mise en page de texte, comme Aldus PageMaker.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[45,46,47,48,49,51],\"columns\":2} -->\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/large02-1.jpg\" alt=\"\" data-id=\"45\" data-link=\"http://192.168.33.60/projet3/wordpress/index.php/page-d-exemple/large02-1/\" class=\"wp-image-45\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.33.60/projet3/wordpress/wp-content/uploads/2019/12/lg-g-sync-oled-2.jpg\" alt=\"\" data-id=\"46\" data-link=\"http://192.168.